import axios from 'axios';

function News() {

    const getNews = async () =>{
        const newsApiKey = "baf89e91a399451dbf982a015897aea1"
        const newsUrl = `https://newsapi.org/v2/everything?q=lima%20Peru&apiKey=${newsApiKey}`;
        const newsResult = await axios.get(newsUrl);
        console.log(newsResult);
    }

    return (
        <article >
            <h1>lorem ipsum lorem ipsum lorem ipsum lorem ipsum</h1>
            <p>lorem ipsum lorlorem ipsum lorem ipsum lorem ipsum</p>
        </article>
    )
}

export default News;
